import React from "react";

class Footer extends React.Component{
    render(){
        return(
        <div className="footer">

            <div className="container-full" style={{backgroundColor: "#30255f", color: "#fff", padding:"20px", textAlign:"center"}}>
                <div className="container">
                 <div className="logo">  <NavLink href="/"><img src={"./quikdev-logo.png"}/> </NavLink></div>
                </div>
            </div>
            <div style={{backgroundColor: "#2b234e", color: "#fff", padding:"20px", textAlign:"center"}} >
                <p>Todos os direitos reservados à QuikDev – 2022. Teste Alex Sulino</p>
            </div>

        </div>    
        );

    }
}
export default Footer;
